Der Kunde meldet, dass im DigiMessage in der Logdatei zwar protokolliert wird, dass SMS nicht versendet werden konnten (Signalisierung zum Braintower), jedoch fehlt laut Kunden die Signalisierung des Dienstes z.B. durch ein Statuswechsel auf Warnung. Durch diesen Statuswechsel wäre in DigiBase Systemmonitor oder im Icinga ein monitoring möglich und der Kunde könnte auf den Nichtversand reagieren. 
{panel}

{panel:title=Gemeldet von Herrn Hoheisel:}
Im Braintower werden alle versendeten Geo SMS protokolliert und der Kunde hat nur die Möglichkeit diese einzeln zu löschen. Da gerade bei Bereichsüberwachungen viele SMS produziert werden, ist das Verfahren einer Einzellöschung nicht zumutbar. 

Der Kunde muss die Protokollierung direkt löschen, nachdem die SMS zugestellt wurde, da es sich um personenbezogene Daten handelt laut Einstufung ZKAK.
{panel}

 
